import React, { Component } from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom'; // Impor komponen dari react-router-dom
import { Home, Sukses } from './pages'; // Pastikan Anda memiliki komponen Home dan Sukses yang didefinisikan


export default class App extends Component {
  render() {
    return (
      <BrowserRouter>
        <NavbarComponent />
        <main>
          <Switch>
            <Route path="/" page={Home} exact />
            <Route path="/sukses" page={Sukses} exact />
          </Switch>
        </main>
      </BrowserRouter>
    );
  }
}
